import React from 'react';

class SearchBar extends React.Component {


    render() {
        return (
            <div className="search-bar ui segment">
                <form>
                    <div>
                        <label>Video Search</label>
                        <input type="text" value={this.state.term} />
                    </div>
                </form>
            </div>
        );
    };
};

export default SearchBar;
